public class Structure { 
  private Object[] con; 
  private int size; 

  public Structure() { 
    con = new Object[10]; 
    size = 0; 
  } 

  public void add(Object x){ 
    insert(size, x); 
  } 

  public Object get(int pos){ 
    return con[pos]; 
  } 

  public void insert(int pos, Object obj){ 
    ensureCapcity(); 
    for(int i = size; i > pos; i--) 
      con[i] = con[i - 1]; 
    con[pos] = obj; 
    size++; 
  } 

  public Object remove(int pos){ 
    Object removedValue = con[pos]; 
    for(int i = pos; i < size - 1; i++) 
      con[i] = con[i + 1]; 
    con[size - 1] = null; 
    size--; 
    return removedValue; 
  } 

  public int size(){ 
    return size; 
  } 

  private void ensureCapcity(){ 
    if(size == con.length) 
      resize(); 
  } 

  private void resize() { 
    Object[] temp; 
    temp = new Object[con.length * 2]; 
    for(int i = 0; i < con.length; i++) 
      temp[i] = con[i]; 
    con = temp; 
  } 
} 
